import React from 'react';
import { motion } from 'framer-motion';
import { Link } from 'react-router-dom';
import logo from '../components/Assets/logo.png';
import github from '../components/Assets/github.png';
import telegram from '../components/Assets/telegram.png';
import vk from '../components/Assets/vk.png';
import '../styles/Footer.css';

function Footer() {
  return (
    <div className='footer'>
      <div className='foot-logo'>
        <img src={logo} alt="Логотип" />
        <p>Наценочка</p>
      </div>
      <div className="contact-info">
        <p><img src={phoneIcon} alt="Телефон" /> +7 (XXX) XXX-XX-XX</p>
        <p>support@example.com</p>
      </div>
      <div className="social-icons">
        <a href="https://github.com/yourgithub" target="_blank" rel="noopener noreferrer">
          <img src={github} alt="GitHub" />
        </a>
        <a href="https://telegram.me/yourtelegram" target="_blank" rel="noopener noreferrer">
          <img src={telegram} alt="Telegram" />
        </a>
        <a href="https://vk.com/yourvk" target="_blank" rel="noopener noreferrer">
          <img src={vk} alt="VK" />
        </a>
      </div>
    </div>
  );
}

export default Footer;
